        datasets: [
            {
                label: 'data',
                data: [chatrData.A, chartData.B, chartData.C, chartData.D, chartData.F],
                backgroundColor: 'aqua',
                borderWidth: '1',
            }
        ]
    }

    const options = {};

    return(
        <Bar data={data} options={options}></Bar>
    )

}

